// IsGeneralCategoryOther reports whether the rune has property "General_Category"="Other".
// Property "General_Category" known as "gc", "General_Category".
// Value "Other" known as "C", "Other".
func IsGeneralCategoryOther(r rune) bool {
	const lo = 0x20
	const hi = 0xe01ef
	if r < lo || r > hi {
		return true
	}
	var i = (r - lo) / 64
	var shift = (r - lo) % 64
	return dataArrayIsGeneralCategoryOther[i]&(1<<uint(shift)) != 0
}

